import React from 'react'

function Header( props ) {
    return (
        <div>
            {
                props.map((user, i) => {
                    return (
                        <Name
                          key={i}
                          id={user[i].id}
                          name={user[i].name}
                          email={user[i].email}
                          />
                      );
                })
            }
        </div>
    )
}

export default Header
